import { personType} from './person-type.model';
import {employmentType} from './employment.model';
import { session } from './session.model';
import { person } from './person.model';


export class attendee extends person{
    school: string
    isEmployed: boolean
    employmentType: employmentType
    personType: personType
    personTypeKeys = [];
    selectedOptions: { [key: string]: boolean } = {};

    constructor (){
        super()
        this.school = "";
        this.personType = personType.unset;
        this.isEmployed = false; 
        this.employmentType = employmentType.unset;

        this.personTypeKeys = Object.keys(this.personType).filter(f => isNaN(Number(f)));
    this.personTypeKeys.forEach((key) => {
      this.selectedOptions[key] = false;
    });
 }
}
